//vars

// navigation
.nav {
  padding: 0px 0 10px 0;
  & ul {
    list-style-type: none;
    float: right;
    margin-right: 25px;
  }
  & li {
    display: inline;
    margin-left: 20px;
  }
  & a {
    color: #000;
    font-size: 18px;
  }
  & a:hover,
  & a:focus,
  & a:active {
    color: #e2ff00;
  }

  & .logo {
    width: 12%;
    height: auto;
    margin-left: 25px;
    margin-top: 14px;
  }
}

.main-container {
  & .bottom-pad {
    padding-bottom: 5%;
  }
  & .col-md-6 {
    padding: 0 45px 0 45px;
  }
  & .col-md-2 {
    padding: 0 30px 0 30px;
  }
  & p {
    font-size: 20px;
  }
}

.offset-shoe {
  // margin-left: 3.33333333%;
  padding-top: 1% !important;
  & p {
    left: 160px;
    position: relative;
    bottom: 35px;
  }
}

//work pages
#dark-nav {
  background-color: #000;
  & a {
    color: #fff;
  }
}

.work-container {
  padding: 40px 25px 0 25px;

  &#graphic {
    background-color: #000;
    padding: 40px 200px 0 200px;
    min-height: 100vh;
  }

  & .nav {
    padding-bottom: 50px;
  }

  & .row {
    padding-bottom: 50px;
  }
}

//rotate
.text {
  font-weight: 900;
